import React, { Component } from 'react';
import Tab from '../Tab/Tab';
import './Tabs'

export default class Tabs extends Component {

    render() {
        var allTabs = [];
        var i;
        for(i = 0; i < 5; i++) {
            allTabs.push(<Tab index={i}/>);
        }

        return(
            <div className='tabs'>
                {allTabs}
            </div>
        );
    }
}
